function CopyHere() {
    var copyText = document.getElementById("myInput");
    copyText.select();
    copyText.setSelectionRange(0, 99999);
    navigator.clipboard
    .writeText(copyText.value)
    .then(() => {
        alert("URL has been Copied");
    })
    .catch(() => {
        alert("Something went wrong");
    });
    }

