function downloadPNG() {
    var size = document.getElementById('size').value;
    var file = document.querySelector('input[name="file"]').value;
    var categorySlug = document.querySelector('input[name="category_slug"]').value;
    var url = `https://uxwing.com/wp-content/themes/uxwing/download/resize.php?size=${size}&file=${file}&category_slug=${categorySlug}`;
    window.location.href = url;
}

function copySVG() {
    var svgUrl = "https://uxwing.com/wp-content/themes/uxwing/download/brands-and-social-media/x-social-media-black-icon.svg"; // Replace "your_svg_file_url_here" with the URL of your SVG file

    // Fetch the SVG file
    fetch(svgUrl)
    .then(response => response.text())
    .then(svgData => {
        // Create a temporary textarea to hold the SVG code
        var tempTextArea = document.createElement("textarea");
        tempTextArea.value = svgData;

        // Append the textarea to the body
        document.body.appendChild(tempTextArea);

        // Select the textarea content
        tempTextArea.select();
        tempTextArea.setSelectionRange(0, 99999); /* For mobile devices */

        // Copy the selected text
        document.execCommand("copy");

        // Remove the textarea
        document.body.removeChild(tempTextArea);

        // Inform the user that the SVG code has been copied
        alert("SVG code copied now you can paste it directly to your design software.");
    })
    .catch(error => {
        console.error('Error fetching SVG:', error);
        alert("Error fetching SVG. Please try again later.");
    });
}

